def sddevdevicedetail_info():    import requests    import time    import json    response = requests.post("http://sddev.infinitylabs.in/api/login/", headers={"Content-Type": "application/x-www-form-urlencoded"}, data = "username=admin&password=admin@123")    res = response.json()    x = json.dumps(res)    db = json.loads(x)    y=db["token"]    xyz= 'Bearer '+y    code = requests.get("http://sddev.infinitylabs.in/api/devices/", headers={"Content-Type": "application/x-www-form-urlencoded", 'Authorization': xyz})    v=code.json()    i=v['data']    g = json.dumps(i)    db1 = json.loads(g)        serialNo=db1[0]['serial']    newURL = "http://sddev.infinitylabs.in/api/devices/"+serialNo    #print(newURL)    res1= requests.get(newURL, headers={"Content-Type": "application/x-www-form-urlencoded", 'Authorization': xyz})    mess = res1.json()       return "Current running device detail is", mess['message']print(sddevdevicedetail_info())